        <div className='Main'>
              <Sidebar bgColor='white' isCollapsed={false}>
              <Item bgColor='black'>
          <Icon><i className="far fa-address-book"/></Icon>
          Contacts
        </Item>
              </Sidebar>
        </div>
    )
}

export default Main
